PictureTokenFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "openzeppelin-contracts/contracts/access/Ownable.sol";

import "./Picture.sol";
import "./PictureToken.sol";

contract PictureTokenFactory {

    Picture props;

    function createPictureToken (
        Picture _props
    ) public {       
        PictureToken newPictureToken = new PictureToken(
            msg.sender,
            _props
        );
    }
}

PictureToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "openzeppelin-contracts/contracts/access/Ownable.sol";

import "./Picture.sol";

contract PictureToken is Ownable {

    Picture props;

    constructor(
        address initialOwner,
        Picture _props
        )
        Ownable(initialOwner)
    {
        props = _props;
    }

}

Picture.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Picture {

    string bigPictureName;
    uint8 order;
    string image;

    constructor (
        string memory _bigPictureName,
        uint8 _order,
        string memory _image
    ) {
        bigPictureName = _bigPictureName;
        order = _order;
        image= _image;
    }
}

